import React, { useEffect, useState } from 'react';

function UsersWithRecipes() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000/users-with-recipes')
      .then(response => response.json())
      .then(data => setUsers(data))
      .catch(error => console.error('Error:', error));
  }, []);

  return (
    <div>
      <h1>Utilisateurs avec leurs Recettes de Fruits de Mer</h1>
      {users.map(user => (
        <div key={user.id}>
          <h2>{user.email}</h2>
          <ul>
            {user.recipes.map(recipe => (
              <li key={recipe.idMeal}>
                <img src={recipe.strMealThumb} alt={recipe.strMeal} />
                <p>{recipe.strMeal}</p>
              </li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
}

export default UsersWithRecipes;
